jQuery(function($) {
    "use strict";
    
    // Hide preloader
    jQuery(window).on('load', function () {
        var preloader = jQuery(".t42-preloader");
        var spinner   = preloader.find('.t42-spinner');
        spinner.fadeOut(100);
        preloader.delay(350).fadeOut(200);
        jQuery("html, body").css("overflow", "visible");
        
        // Home Page Tabs ajustments
        setTimeout(function () {
            jQuery(window).trigger('resize');
        }, 1000);
    });
    
    // fadeOut for page out
    jQuery(window).on('beforeunload', function(){
        var preloader = jQuery(".t42-preloader");
        var spinner   = preloader.find('.t42-spinner');
        preloader.fadeIn(200);
        spinner.delay(350).fadeIn();
    });
    
    // Open external links in new window
    jQuery('a:not([data-uk-lightbox]), #adminForm a').each(function () {
        if (typeof this.href !== typeof undefined && this.href !== false && this.href.trim() !== "" && !(this.href.indexOf("javascript") !=-1) ) { // Element has this attribute
            // Element has this attribute
            var a = new RegExp('/' + window.location.host + '/');
            if (!a.test(this.href)) { // Ссылка другой хост или не васккрипт
                jQuery(this).on('click', function (event) {
                    event.preventDefault();
                    event.stopPropagation();
                    window.open(this.href, '_blank');
                });
            }
        }
    });
    
    // Ripple Effect (by http://codepen.io/440design/pen/iEztk)
    (function(){
        var ink, d, x, y;
        jQuery(".uk-navbar-nav li > a, .uk-button, .uk-subnav-pill > li > a, .uk-nav-side > li > a, .uk-nav-offcanvas > li > a").on('click', function(e){

            var element = jQuery(this);

            if(element.find(".t42-ripple").length === 0){
                element.prepend("<span class='t42-ripple'></span>");
            }

            ink = element.find(".t42-ripple");
            ink.removeClass("t42-animate-ripple");

            if(!ink.height() && !ink.width()){
                d = Math.max(element.outerWidth(), element.outerHeight());
                ink.css({height: d, width: d});
            }

            x = e.pageX - element.offset().left - ink.width()/2;
            y = e.pageY - element.offset().top - ink.height()/2;

            ink.css({top: y+'px', left: x+'px'}).addClass("t42-animate-ripple");
        });
    })();
    
});
